//nolint:revive,govet,errcheck
package development

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_GPS_AUTHENTICATION_STATE(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e GPS_AUTHENTICATION_STATE
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := GPS_AUTHENTICATION_STATE_UNKNOWN.MarshalText()
		require.NoError(t, err)

		var dec GPS_AUTHENTICATION_STATE
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, GPS_AUTHENTICATION_STATE_UNKNOWN, dec)
	})
}
